function datetime(){if(!(this instanceof datetime))return new datetime}datetime.prototype.getDateTimeString=function(){var t=new Date,e=((e=t.getHours())<10?"0":"")+e,n=((n=t.getMinutes())<10?"0":"")+n,a=((a=t.getSeconds())<10?"0":"")+a,i=t.getFullYear(),r=((r=t.getMonth()+1)<10?"0":"")+r,t=t.getDate();return i+"_"+r+"_"+((t<10?"0":"")+t)+"#"+e+":"+n+":"+a},datetime.prototype.getDateString=function(){var t=new Date,e=t.getFullYear(),n=((n=t.getMonth()+1)<10?"0":"")+n,t=t.getDate();return e+"_"+n+"_"+((t<10?"0":"")+t)},module.exports=datetime;